export default function Game() {
    function Game() {
        window.location.href = ""
    }
    return (
    <div className = "GamePage">
    <h1> Game </h1>
    <div className = "TextDiv">
        <box className = "TextBox">
            <h2> Game img </h2>
            <button onClick = {Game}> Go to the Game</button>
        </box>
    </div>
    </div>
    )
}
